import React from 'react';
import { ThemeProvider } from 'emotion-theming';
import './App.css';
import {
  Box,
  Card,
  Image,
  Heading,
  Text,
  Flex,
  Link
} from 'rebass';
import theme from '@rebass/preset'


function App() {
  return (
    <ThemeProvider theme={theme}>
      <Flex
        px={2}
        py={2}
        color='white'
        bg='black'
        alignItems='center'>
        <Text p={2} fontWeight='bold'>Portfolio</Text>
        <Box mx='auto' />
        <Link variant='nav' href='#'>
          Profile
  </Link>
        <Link variant='nav' href='#'>Resume</Link>
        <Link variant='nav'>Github</Link>
      </Flex>
    </ThemeProvider>
  );
}

export default App;
